function WordLoader () {
	this.result = '';
}

WordLoader.prototype = {
	constructor : WordLoader, 
	rule : {
		M : { "key": " M ", "length": 2 },
		L : { "key": " L ", "length": 2 },
		Q : { "key": " C ", "length": 4 },
		Z : { "key": " Z ", "length": 0 }
	},
	load: function ( ele, start, value ){
		var index = ele.length;
		var str = '';
		
		if( value == 1 ) {
			str = ele+'+';
		}
		else if ( value == 0 ) {
			str = ele;
		}
		else if( value == -1 ) {
			str = ele+'-';
		}
		else{
			if(value<0) {
				str = ele+((value+'').substring(1))+'-';
			}
			else {
				str = ele+value+'+';
			}
		}
		//console.log( str )
		
		var len = str.length;
		
		var resultStr = '';
		
		for(var j = 0; j<len; j++) {
			var s = start.clone();
			var json = Word[ str.charAt(j) ];
			
			if( j>0 ){start.x += 10}
			if( j>index-1 ){ s.y = s.y-5 }
			var count = -1;
			for( var i = 0; i<json.commands.length; i++ ) {
				if( i<=0 || this.rule[ json.commands[i] ].key != this.rule[ json.commands[i-1] ].key ){
					resultStr += this.rule[ json.commands[i] ].key;
				}
				
				var l = this.rule[ json.commands[i] ].length;
				
				if( l == 2 ) {
					var x1 = json.points[ count+1 ]+start.x-5,
						y1 = json.points[ count+2 ]+s.y+4;
						
					resultStr += (x1+" "+y1+" ");
				}
				else if( l == 4 ) {
					var x1 = json.points[ count+1 ]+start.x-5,
						y1 = json.points[ count+2 ]+s.y+4,
						x2 = json.points[ count+3 ]+start.x-5,
						y2 = json.points[ count+4 ]+s.y+4;
					
					
					resultStr += (x1+" "+y1+" "+x2+" "+y2+" "+x2+" "+y2+" ")
				}
				
				count += l;
				
			}
		}
		this.result = resultStr;
	}
	
};



